//Reset the all recent changes go back to existing assignment page
    Reset(ComboBox1_2);
    Reset(ComboBox2_2);
    Reset(ComboBox3_2);
    Reset(ComboBox4_2);
    Reset(ComboBox5_2);
    Reset(DatePicker2_2);
    Reset(DatePicker1_4);
    Reset(DatePicker1_5);
  Set(IsEdit,true);
  Navigate(projectAssignment,ScreenTransition.None);

If(
    Connection.Connected = false,
    Notify("Network is not Available",NotificationType.Error),

    If(
        IsBlank(ComboBox2_2.Selected.Go_Number),
        Notify(
            "Please Select Bank.",
            NotificationType.Error
        ),
        IsBlank(ComboBox3_2.Selected.type),
        Notify(
            "Please Select Assessment Type.",
            NotificationType.Error
        ),
         IsBlank(ComboBox4_2.Selected.displayName),
        Notify(
            "Please Select Assessor.",
            NotificationType.Error
        ),
        IsBlank(ComboBox5_2.Selected.displayName),
        Notify(
            "Please Select Reviewer.",
            NotificationType.Error
        ),
          
        IsBlank(DatePicker1_4.SelectedDate),
        Notify("Please Select Due Date",NotificationType.Error),
         
        DateDiff(
            DatePicker2_2,
            DatePicker1_4
        ) <= 0,
        Notify("The Due date can not be before Assessment start date"),

        Set(
            patchresult,
            Patch(
                projectAssignment_1,
                LookUp(
                    projectAssignment_1,
                    'projectAssignment (quantum_projectassignment)' = nprojectassignment
                ),
                {
                    // 'projectAssignment (quantum_projectassignment)': "upass11",
                   // clientId: LookUp(
                   //     Client,
                    //    client_name = ComboBox1_2.Selected.client_name
                   // ),
                    bankId: LookUp(
                        bank,
                        Go_Number = ComboBox2_2.Selected.Go_Number
                         // ThisRecord.Go_Number
                    ),
                    assessment_type_1: ComboBox3_2.Selected.type,
                    assessor_id: LookUp(
                        AssessorAD,
                        displayName = ComboBox4_2.Selected.displayName,
                        id
                    ),
                    reviewer_id: LookUp(
                        ReviewerAD,
                        displayName = ComboBox5_2.Selected.displayName,
                        id
                    ),
                    start_date: DatePicker2_2.SelectedDate,
                    due_date: DatePicker1_4.SelectedDate,
                    'Assigned_date ': DatePicker1_5.SelectedDate,
                    IsComplete: "Upcomming",
                    assessor_email: LookUp(
                        AssessorAD,
                        displayName = ComboBox4_2.Selected.displayName,
                        mail
                    ),
                    Reviewer_email: LookUp(
                        ReviewerAD,
                        displayName = ComboBox5_2.Selected.displayName,
                        mail
                    ),
                    assessor_name: LookUp(
                        AssessorAD,
                        displayName = ComboBox4_2.Selected.displayName,
                        displayName
                    ),
                    reviewer_name: ComboBox5_2.Selected.displayName
                     
                }
            )
        );

          
     If(!IsBlank(patchresult),
     //Notify("Success");
       Set(updatePopup,true);
        Reset(ComboBox1_2);
        Reset(ComboBox2_2);
        Reset(ComboBox3_2);
        Reset(ComboBox4_2);
        Reset(ComboBox5_2);
        Reset(DatePicker2_2);
        Reset(DatePicker1_4);
        Reset(DatePicker1_5);
       
   ,Notify("Error patch function "));

  
    );  
      
);

